Information
------------------------------

Luxury Trains (Part Three)
They're one of the best-kept secrets in the world of first class travel. As exclusive as a private jet, and as luxurious as a yacht, these amazing railroad passenger cars - some faithfully restored, others artfully reimagined- now crisscross the country, bringing the romance of the rails into the 21st century.
Part first class hotel, part four star restaurant, you'll see how these virtual time machines bring America's finest sights within arms length, and make getting there half the fun.
From luxurious lounge cars and panoramic dome cars, to cozy sleepers, and Art Deco-inspired Streamliners, you'll see how their private owners combine passion, perseverance, and plenty of cash, to turn these historic cars in the plushest, most elegant, most tricked out trains on the rails today.

